import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () =>
{
	return (
		<ul>
			<li>Дело №1</li>
			<li>Дело №2</li>
		</ul>
	);
};

const AppHeader = () =>
{
	return (<h1>Список дел</h1>);
};

const SearchPanel = () =>
{
	return(
		<input placeholder="search"/>
	);
};

const el = (
	<div>
		<AppHeader/>
		<SearchPanel/>
		<TodoList/>
	</div>
);
//console.log(el);
ReactDOM.render(el, document.getElementById('root'));
